import React, { useState, useEffect } from 'react';

function Teams() {
  const [teams, setTeams] = useState([]);

    useEffect(() => {
    const fetchData = async () => {
        const res = await fetch('../db/data.json');
        const json = await res.json();
        setTeams(json);
    };
    fetchData();
    }, []);

    return (
        <div>
            <h1>Data</h1>
        </div>
      );
}

export default Teams
